/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "libraries-used"
    }}>{`Libraries Used`}</h1>
    <p>{`MQTTCon using React 16.8.4:`}</p>
    <blockquote>
      <ul>
  <li>aws-iot-device-sdk 2.2.1</li>
  <li>express 4.16.4</li>
  <li>nodemon 1.18.10</li>
      </ul>
    </blockquote>
    <p>{`react-app using React 16.8.4:`}</p>
    <blockquote>
      <ul>
  <li>aws-amplify 1.1.26</li>
  <li>mdbreact 4.11.0</li>
  <li>react, react-dom</li>
  <li>react-router 4.3.1</li>
  <li>react-router-dom 4.3.1</li>
  <li>enzyme 3.9.0</li>
  <li>enzyme-adapter-react-16 1.11.2</li>
  <li>jest-enzyme 7.0.2</li>
      </ul>
    </blockquote>
    <p>{`Raspberry Pi using Python 3.0:`}</p>
    <blockquote>
      <ul>
  <li>GPIO</li>
  <li>aws-iot-device-sdk-python</li>
      </ul>
    </blockquote>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
